{"version":3,"sources":["../../../../../../../src/build/webpack/config/blocks/css/loaders/file-resolve.ts"],"sourcesContent":["export function cssFileResolve(
  url: string,
  _resourcePath: string,
  urlImports: any
) {
  if (url.startsWith('/')) {
    return false
  }
  if (!urlImports && /^[a-z][a-z0-9+.-]*:/i.test(url)) {
    return false
  }
  return true
}
